import React from 'react';
import {
    StyleSheet,
    View,
    Text,
    SafeAreaView,
    
} from 'react-native';
import { useNavigation } from '@react-navigation/native';

export default function ContactScreen() {
    const navigation = useNavigation();
    return (
        <>
            <View style={styles.homeContainer}>
                <Text style={styles.homeHeading}>Help & Support</Text>
                <Text style={styles.homeContent}>The working principles of React Native are virtually identical to React except that React Native does not manipulate the DOM via the Virtual DOM. It runs in a background process (which interprets the JavaScript written by the developers) directly on the end-device and communicates with the native platform via serialized data over an asynchronous and batched bridge.</Text>
                <SafeAreaView>
                    <TextInput
                        onChangeText={(text) => setEmail(text)}
                        value={email}
                        style={styles.emailInput}
                        placeholder="Enter your email"
                    />
                    <TouchableHighlight onPress={handleSubmit} style={styles.button}>
                        <Text style={styles.buttonText}>Submit</Text>
                    </TouchableHighlight>
                </SafeAreaView>
            </View>
        </>
    );
}

const styles = StyleSheet.create({
    homeContainer: {
      backgroundColor: '#ffffff',
      margin: 12,
      padding: 16,
      fontFamily: 'arial',
      color: '#666',
      borderRadius: 16,
    shadowOpacity: 0.2,
    shadowRadius: 4,
    shadowColor: 'black',
    shadowOffset: {
      height: 0,
      width: 0,
    },
    elevation: 1,
    },
    homeHeading: {
      fontSize: 16,
      fontWeight: 'bold',
      color: '#666'
    },
    
    homeContent: {
      fontSize: 14,
      paddingTop:6,
      paddingBottom: 6,
      lineHeight: 20
    },
    
});
